INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (1267, 4278, 'Nifedipine', 'The consumption of grapefruit juice may be associated with significantly increased plasma concentrations of some calcium channel blockers (CCBs) when they are administered orally.  The proposed mechanism is inhibition of CYP450 3A4-mediated first-pass metabolism in the gut wall by certain compounds present in grapefruit.  The interaction has been reported with the dihydropyridine CCBs (in roughly decreasing order of magnitude) felodipine, nisoldipine, nifedipine, and nimodipine, often with a high degree of interindividual variability.  Grapefruit juice caused more than twofold increases in felodipine, nifedipine, and nisoldipine AUCs.', 'grapefruit juice', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (1268, 4279, 'Nifedipine', 'The consumption of grapefruit juice may be associated with significantly increased plasma concentrations of some calcium channel blockers (CCBs) when they are administered orally.  The proposed mechanism is inhibition of CYP450 3A4-mediated first-pass metabolism in the gut wall by certain compounds present in grapefruit.  The interaction has been reported with the dihydropyridine CCBs (in roughly decreasing order of magnitude) felodipine, nisoldipine, nifedipine, and nimodipine, often with a high degree of interindividual variability.  Grapefruit juice caused more than twofold increases in felodipine, nifedipine, and nisoldipine AUCs.', 'grapefruit juice', 'Moderate', '', 'DDInter', 0, X'', NULL, X'');
