INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (1276, 4285, 'Norfloxacin', 'Concurrent ingestion of meals, dairy products (milk, yogurt) or calcium-fortified foods (i.e., cereal, orange juice) may decrease the absorption of oral norfloxacin.  The mechanism is chelation of calcium and the quinolone, resulting in decreased bioavailability.  In the case of orange juice, inhibition of intestinal transport mechanisms (P-glycoprotein or organic anion-transporting polypeptides) by flavones may also be involved.', 'orange juice', 'Moderate', '', 'DDInter', 0, X'789c1dccd10dc2300c84e1556e80c22acc601247b5eae490e30ad89e94d7ef3fdd23c43118cdf991620373e7e9154f45caa10392709599e050ac162b358682817cf34f13d2520382aee21bbaf9b15d03e6beb88ac517af603d4bcecb8b78b1b3dfd6515a33ad68649df71f7bac33e0', NULL, X'');
