INSERT OR REPLACE INTO food_interactions (id, med_id, trade_name, interaction, ingredient, severity, reference_text, source, created_at, management_text_blob, mechanism_text_blob, interaction_blob) VALUES (1356, 1088, 'Atorvastatin', 'Concomitant use of statin medication with substantial quantities of alcohol may increase the risk of hepatic injury.  Transient increases in serum transaminases have been reported with statin use and while these increases generally resolve or improve with continued therapy or a brief interruption in therapy, there have been rare postmarketing reports of fatal and non-fatal hepatic failure in patients taking statins.  Patients who consume substantial quantities of alcohol and/or have a history of liver disease may be at increased risk for hepatic injury.  Active liver disease or unexplained transaminase elevations are contraindications to statin use.', 'alcohol', 'Moderate', '', 'DDInter', 0, X'789c4d8ed10dc2300c4457b909988515dcc4552c52bbc40e85ed71111ffdb34e7eefee4e21ace1f066b3572c8c62539d3b5784815e26153e170fd210ea78cef348ca612ba8176bd6219adcb688a6cf148744432291f9c655ca2f769056942e2a4548afa574d0e053188d53560693e78221fec06a038d770a0b7b27199fb32e1f9db1fff7dfbefa2e4bc6', NULL, X'');
